import React from 'react';
import { 
  BsSearch, 
  BsBarChart, 
  BsGear, 
  BsFileText,
  BsFilter,
  BsSave,
  BsTrash 
} from 'react-icons/bs';

// Definindo componentes funcionais nomeados
function SearchIcon() {
  return <BsSearch style={{ fontSize: '1.2rem' }} />;
}

function ChartIcon() {
  return <BsBarChart style={{ fontSize: '1.2rem' }} />;
}

function GearIcon() {
  return <BsGear style={{ fontSize: '1.2rem' }} />;
}

function FileIcon() {
  return <BsFileText style={{ fontSize: '1.2rem' }} />;
}

function FilterIcon() {
  return <BsFilter style={{ fontSize: '1.2rem' }} />;
}

function SaveIcon() {
  return <BsSave style={{ fontSize: '1.2rem' }} />;
}

function TrashIcon() {
  return <BsTrash style={{ fontSize: '1.2rem' }} />;
}

// Exportando os componentes
export {
  SearchIcon,
  ChartIcon,
  GearIcon,
  FileIcon,
  FilterIcon,
  SaveIcon,
  TrashIcon
};
